import React from 'react';
import './App.css';

import './Components/header/Header';
import Header from './Components/header/Header';
import Home from './Components/home/Home';
function App() {
  return (
    <div className="App">
      <Header></Header>
      <Home></Home>
    </div>
  );
}

export default App;
